    this.Lunar = Lunar;

    //namespace
    this.itour = this.itour ? this.itour : {};
    this.itour.ui = this.itour.ui ? this.itour.ui : {};


    var hasInitHL = false;
    var holidayList = [];

    //农历节日列表（农历时间） 月份下标为1
    //可自行增加农历节日
    var lftv = [
    { m: 1, d: 1, name: 'h_cj' }, //春节
    {m: 1, d: 15, name: 'h_yx' }, //元宵
    {m: 5, d: 5, name: 'h_dw' }, //端午
    // { m: 7, d: 7, name: '七夕' },
    {m: 8, d: 15, name: 'h_zc' }
    //, //中秋
    //{ m: 9, d: 9, name: '重阳' },
    //{ m: 12, d: 8, name: '腊八' },
    //{ m: 12, d: 24, name: '小年' },
    //{m: 12, d: 29, name: 'h_cx'}//除夕
    ];

    var setHolidayList = function (fdate) {
        //TODO 设置公历节日 月份下标为0
        //可自行增加公历节日
        holidayList = [
        { m: 0, d: 1, name: 'h_yd' }, //元旦
        {m: 3, d: 4, name: 'h_qm' }, //清明
        {m: 4, d: 1, name: 'h_wy' }, //五一
        {m: 9, d: 1, name: 'h_gq'} //国庆
        //, { m: 11, d: 25, name: '圣诞' }
        ];

        for (var i = 0; i < 62; i++) {
            var d = new Date();
            d.setTime(fdate.getTime() + i * 86400000);
            //            var tempDate = new Date();
            //            tempDate.setFullYear(d.getFullYear());
            //            tempDate.setMonth(d.getMonth());
            //            tempDate.setDate(d.getDate());

            var lunar = new Lunar(d);
            var o = {
                d: Math.floor(lunar.day),
                m: lunar.month
            };

            for (var j = 0; j < lftv.length; j++) {
                if (o.m == lftv[j].m && o.d == lftv[j].d){
                    holidayList.push({ m: d.getMonth(), d: d.getDate(), name: lftv[j].name });
                }
            }
        }

    };
    var checkHoliday = function (date) {
        for (var i = 0; i < holidayList.length; i++){
            if ((holidayList[i].y == undefined || (date.getFullYear() == holidayList[i].y)) && date.getMonth() == holidayList[i].m && date.getDate() == holidayList[i].d){
                return holidayList[i].name;
            }
        }
        return '';
    };

    $.datepicker.extendGetDate = function (date) {
        if (!hasInitHL) {
            //init tranditional date list here 
            setHolidayList(date);
            hasInitHL = true;
        }
        var result = checkHoliday(date);
        return result == '' ? date.getDate() : "<span class='" + result + "'>&nbsp;</span>";
    };



    this.itour.ui.datepicker = function (selector, setting) {
        ///<summary>
        ///设置日历控件
        ///</summary>
        ///<param name="selector" type="String|DOM">元素的selector</param>
        ///<param name="setting" type="Object">设置</param>
        var _s = {}; //{ numberOfMonths: 2, showAnim: '', prevText: "", nextText: "", minDate: new Date(), constrainInput: true };

        //  $(selector).attr("readonly", true);
        if (typeof setting !== 'string') {
            _s.onChangeMonthYear = function () {
                hasInitHL = false;
            };

            for (var i in setting) {
                _s[i] = setting[i];
            }
            $(selector).datepicker(_s);
        }
        else {
            var list = [];
            for (var i = 1; i < arguments.length; i++){
                list[list.length] = arguments[i];
            }

            $(selector).datepicker.apply($(selector), list);
        }
    };
